var gui={controls:{use:function(a){$("button.active").removeClass("active");a=a.split(",");$.each(a,function(b,c){$("button."+c).addClass("active")})}},progress:{show:function(){$(".progress").addClass("show")},hide:function(){$(".progress").removeClass("show")}},notify:{done:function(){$(".done").addClass("show");gui.notify.hide()},duplicate:function(){$(".duplicate").addClass("show");gui.notify.hide()},warning:function(){$(".warning").addClass("show");gui.notify.hide()},syntax:function(){$(".syntax").addClass("show");gui.notify.hide()},hide:function(){setTimeout(function(){$(".notify.show").removeClass("show")},3500)}},tween:function(a){$(a).removeClass("show");setTimeout(function(){$(a).addClass("show")},100)}};